# 1074. Number of Submatrices That Sum to Target
class Solution:
    def numSubmatrixSumTarget_0(self, matrix: List[List[int]], target: int) -> int:
        n = len(matrix)
        m = len(matrix[0])
        sumMatrix = [[0]*m for i in range(n)]

        def bruteForce(y, x):
            sumMatrix = [matrix[i].copy() for i in range(n)]
            res = 0

            for i in range(y, n):
                for j in range(x, m):
                    if i == y and j != x:
                        sumMatrix[i][j] += sumMatrix[i][j-1]
                    elif j == x and i != y:
                        sumMatrix[i][j] += sumMatrix[i-1][j]
                    elif i != y and j != x:
                        sumMatrix[i][j] += sumMatrix[i][j-1]
                        sumMatrix[i][j] += sumMatrix[i-1][j]
                        sumMatrix[i][j] -= sumMatrix[i-1][j-1]

                    if sumMatrix[i][j] == target:
                        res += 1

            return res

        res = 0
        for i in range(n):
            for j in range(m):
                res += bruteForce(i, j)

        return res



    def numSubmatrixSumTarget(self, matrix: List[List[int]], target: int) -> int:
        n = len(matrix)
        m = len(matrix[0])

        sumMatrix = [matrix[i].copy() for i in range(n)]

        for i in range(n):
            for j in range(m):
                top = 0 if i == 0 else sumMatrix[i-1][j]
                left = 0 if j == 0 else sumMatrix[i][j-1]
                double = 0 if i == 0 or j == 0 else sumMatrix[i-1][j-1]
                sumMatrix[i][j] += top + left - double

        res = 0
        for r1 in range(n):
            for r2 in range(r1, n):
                count = defaultdict(int)
                count[0] = 1

                for c in range(m):
                    bottom = 0 if r1 == 0 else sumMatrix[r1-1][c]
                    curr = sumMatrix[r2][c] - bottom

                    res += count[curr - target]

                    count[curr] += 1

        return res


